import React from 'react';
import './App.css';
import Hero from './components/Hero';
import Images from './components/Images';
import SignIn from './components/LogIn';

function App() {
  return (
    <>
    < SignIn/>
    <div className="App">
      <Hero />
      < Images/>
    </div>
    </>
  );
}

export default App;
